import React from 'react';

function BlogPage(props) {

  const {carList} = props;
  const {brand, color} = carList  

  const filterListCar = carList.filter((carInfo)=> !carInfo.brand.includes('BMW'));

  const text = `Hi, Im a ${color} ${brand} Car`;

  return (
    <div>
      <h1>Blog Page</h1>

      <h2>{text}</h2>

      <ul>
        { 
          filterListCar.map(
            (carInfo, index) => <li key={carInfo.brand + index}> Hi, Im a {carInfo.brand}  {carInfo.color} Car</li>)}

      </ul>



    </div>
  );
}

export default BlogPage;
